<!doctype HTML>
<html>

<head>
    <title>Tablonix</title>
    <script src="http://code.jquery.com/jquery-3.2.1.min.js" integrity="sha256-hwg4gsxgFZhOsEEamdOYGBf13FyQuiTwlAQgxVSNgt4=" crossorigin="anonymous"></script>
    <style>
        @import url('https://fonts.googleapis.com/css2?family=VT323&display=swap');
        body {
            font-family: 'VT323', monospace;
            font-size: 16px;
            background: #000000;
            text-align: center;
            user-select: none;
            overflow: hidden;
        }

        h1 {
            color: #ffffff;
        }

        .hidden {
            display: none!important;
        }

        #notice {
            position: absolute;
            text-align: center;
            padding: 25% 0;
            display: inline-block;
            width: 100%;
            height: 100%;
            box-sizing: border-box;
            top: 0;
            bottom: 0;
            left: 0;
            right: 0;
            font-size: 3em;
            color: #ffffff;
        }
        #notice a {
            color: #ffffff;
        }

        #wrap {
            position: relative;
            margin: 0 auto;
            padding: 15px;
            width: auto;
            display: inline-block;
        }

        table {
            margin: 0 auto 0;
            width: auto;
            height: auto;
            border-collapse: collapse;
        }

        table,
        table tr,
        table th,
        table td {
            border-collapse: collapse;
            border: 0;
        }

        table#board.hide-cursor {
            cursor: none;
        }

        table#board td {
            position: relative;
            width: 16px;
            height: 16px;
            margin: 0;
            padding: 0;
            border: 0;
            background: #000000;
            box-sizing: border-box;
        }
        table#board td.full,
        table#board td.full.strix {
            background: #00aaa9;
        }
        table#board td.strix {
            background: #ac00a8;
        }
        table#board td.hero {
            background: #ffffff;
        }
        table#board td.hero:after {
            content: '';
            position: absolute;
            border: 4px solid #ac00a8;
            top: 0;
            bottom: 0;
            left: 0;
            right: 0;
            width: 16px;
            height: 16px;
            box-sizing: border-box;
        }
        table#board td.full.hero {
            background: #ac00a8;
        }
        table#board td.full.hero:after {
            border: 4px solid #ffffff;
        }
        table#board td.sparx {
            background: #00aaa9;
        }
        table#board td.sparx:after {
            content: '';
            position: absolute;
            border: 4px solid #ffffff;
            top: 0;
            bottom: 0;
            left: 0;
            right: 0;
            width: 16px;
            height: 16px;
            box-sizing: border-box;
        }
        table#board td.full.sparx {
            background: #00aaa9;
        }
        table#board td.full.sparx:after {
            border: 4px solid #000000;
        }

        tfoot td {
            color: #ffffff;
            text-align: left;
            font-size: 1.5em;
        }
        tfoot td#score:before {
            content: 'Score: ';
        }
        tfoot td#xn:before {
            content: 'Xn: ';
        }
        tfoot td#full:before {
            content: 'Full: ';
        }
        tfoot td#full:after {
            content: '%';
        }
        tfoot td#time:before {
            content: 'TIME: ';
        }
    </style>
</head>

<body>
    <div id="game-container">
        <h1>Tablonix</h1>
        <div id="wrap" class="loading">
            <table id="board">
                <tbody></tbody>
                <tfoot id="hud">
                    <tr>
                        <td id="score"></td>
                        <td id="xn"></td>
                        <td id="full"></td>
                        <td id="time"></td>
                    </tr>
                </tfoot>
            </table>
        </div>
    </div>
    <div id="notice" class="hidden"></div>
    <script type="text/javascript">
        (function() {
            function rand(min, max) {
                return Math.floor(Math.random() * max) + min;
            }

            function shuffle(a) {
                var j, x, i;
                for (i = a.length - 1; i > 0; i--) {
                    j = Math.floor(Math.random() * (i + 1));
                    x = a[i];
                    a[i] = a[j];
                    a[j] = x;
                }
                return a;

AAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAA=');
                    audio.play();
                }
            }

            function Game() {
                let gameContainer = jQuery('#game-container');
                let hud = gameContainer.find('#hud');
                let boardElement = gameContainer.find('#board');
                let scoreHudCol = hud.find('#score');
                let xnHudCol = hud.find('#xn');
                let fullHudCol = hud.find('#full');
                let timeHudCol = hud.find('#time');
                let wrap = jQuery('#wrap');
                let notice = jQuery('#notice');

                this.board = {};
                this.board.cells = [];
                this.board.meta = {};
                this.board.hud = {};

                this.hero = {};
                this.sparxs = [];
                this.edgeSparxs = [];

                let HEIGHT = 50;
                let WIDTH = 100;
                const CELL_SIZE = 16;
                const STANDARD_WAIT = 2500;

                // CELLS enum
                const CELL_TYPES = {
                    EMPTY: 0,
                    FULL: 1,
                    TENTATIVE: 2
                };

                // array of internal cells; useful for sparxs initialization
                this.knut = [];

                this.stopPlaying = function() {
                    this.board.meta.playing = false;
                };

                this.initBoard = function() {
                    let qp = new URLSearchParams(
                        window.location.search.replace('?', '')
                    );
                    this.board.meta.level = qp.has('level')
                        ? qp.get('level')|0
                        : 0;
                    this.board.meta.speed = qp.has('speed')
                        ? qp.get('speed')|0
                        : 100;
                    this.board.meta.displayLevel = this.board.meta.level + 1;
                    this.board.meta.objective = qp.has('objective')
                        ? qp.get('objective')|0
                        : 75;
                    // totally hackable; I don't care
                    this.board.meta.score = qp.has('previous_score')
                        ? qp.get('previous_score')|0
                        : 0;
                    this.board.meta.xn = qp.has('xn')
                        ? qp.get('xn')|0
                        : 3;

                    if (qp.has('w')) {
                        WIDTH = qp.get('w')|0;
                    }
                    if (qp.has('h')) {
                        HEIGHT = qp.get('h')|0;
                    }

                    const tfootColspan = (WIDTH / 4)|0;
                    scoreHudCol.attr('colspan', tfootColspan);
                    xnHudCol.attr('colspan', tfootColspan);
                    fullHudCol.attr('colspan', tfootColspan);
                    timeHudCol.attr('colspan', tfootColspan);

                    this.board.meta.h = HEIGHT;
                    this.board.meta.w = WIDTH;
                    boardElement.css({
                        width: (WIDTH * CELL_SIZE) + 'px',
                        height: (HEIGHT * CELL_SIZE) + 'px',
                    })

                    this.board.meta.timeSpeed = 5000;
                    if (this.board.meta.level >= 15) {
                        this.board.meta.timeSpeed = Math.min(
                            this.board.meta.timeSpeed - (this.board.meta.level * 10),
                            1000
                        );
                    }

                    this.board.meta.time = 90;
                    this.board.meta.initialTime = this.board.meta.time;

                    this.board.meta.full = 0;

                    this.board.meta.internalSparxs = 3;
                    this.board.meta.internalSparxs += (this.board.meta.level < 15)
                        ? this.board.meta.level - ((this.board.meta.level / 5)|0) - 1
                        : 14;
                    this.board.meta.edgeSparxs = Math.min(
                        (this.board.meta.level / 5)|0,
                        3
                    ) + 1;

                    this.board.meta.totalEmptyCells = 0;
                    this.board.meta.totalEdgeCells = 0;

                    for (let y = 0; y < this.board.meta.h; ++y) {
                        let tr = jQuery('<tr/>').data('y', y);
                        let row = [];
                        for (let x = 0; x < this.board.meta.w; ++x) {
                            let td = jQuery('<td/>')
                                .data('y', y)
                                .data('x', x)
                                .attr('id', x + '-' + y);
                            tr.append(td);
                            let isEdge = (
                                (y < 2 || y >= this.board.meta.h - 2)
                                || (x < 2 || x >= this.board.meta.w - 2)
                            );
                            row.push({
                                x: x,
                                y: y,
                                state: isEdge ? CELL_TYPES.FULL : CELL_TYPES.EMPTY,
                                el: td
                            });
                            if (!isEdge) {
                                this.knut.push({ x: x, y: y });
                                this.board.meta.totalEmptyCells += 1;
                            } else {
                                this.board.meta.totalEdgeCells += 1;
                            }
                        }
                        boardElement.append(tr);
                        this.board.cells.push(row);
                    }

                    this.initHero();

                    this.initSparxs();

                    this.fullRender();

                    this.stopPlaying();

                    wrap.removeClass('loading');
                };

                this.initHero = function() {
                    // clean from hero, just in case
                    boardElement.find('.hero').removeClass('hero');
                    this.hero.x = (this.board.meta.w / 2)|0;
                    this.hero.y = 0;
                    this.hero.old_x = this.hero.x;
                    this.hero.old_y = this.hero.y;
                    this.hero.h_dir = null;
                    this.hero.v_dir = null;
                    this.hero.strix = [];
                };

                this.initSparxs = function() {
                    // edge sparxs
                    for (let i = 0; i < this.board.meta.edgeSparxs; ++i) {
                        let x = (i == 0 || i == 1)
                            ? (this.board.meta.w / 2)|0
                            : (
                                (i == 2)
                                    ? 0
                                    : this.board.meta.w - 1
                            );
                        let y = (i == 0 || i == 1)
                            ? this.board.meta.h - 1
                            : (this.board.meta.h / 2)|0;
                        this.edgeSparxs.push({
                            x: x,
                            y: y,
                            old_x: x,
                            old_y: y,
                            h_dir: (i % 2) ? 1 : -1,
                            v_dir: (i % 2) ? 1 : -1
                        });
                    }
                    // internal sparxs
                    shuffle(knut);
                    for (let i = 0; i < this.board.meta.internalSparxs; ++i) {
                        let h_dir = rand(0, 1);
                        let v_dir = rand(0, 1);
                        this.sparxs.push({
                            x: knut[i].x,
                            y: knut[i].y,
                            old_x: knut[i].x,
                            old_y: knut[i].y,
                            h_dir: (h_dir = 0) ? -1 : 1,
                            v_dir: (v_dir = 0) ? -1 : 1
                        });
                    }
                    delete this.knut;
                };

                this.getCell = function(x, y) {
                    if (typeof this.board.cells[y] === 'undefined' || typeof this.board.cells[y][x] === 'undefined') {
                        return null;
                    }
                    return this.board.cells[y][x];
                };

                this.isStrixing = function() {
                    return this.hero.strix.length > 0;
                };

                this.cleanStrix = function() {
                    boardElement.find('.strix').removeClass('strix');
                };

                this.stopStrixing = function() {
                    for (let i in this.hero.strix) {
                        this.hero.strix[i].el.removeClass('strix').removeClass('hero');
                    }
                    // just to be sure
                    this.cleanStrix();
                    this.hero.strix = [];
                };

                this.renderHero = function() {
                    let oldCell = this.getCell(this.hero.old_x, this.hero.old_y);
                    oldCell.el.removeClass('hero');
                    if (this.isStrixing()) {
                        oldCell.el.addClass('strix');
                    }
                    this.getCell(this.hero.x, this.hero.y).el.addClass('hero');
                };

                this.renderSparx = function(sparx) {
                    this.getCell(sparx.old_x, sparx.old_y).el.removeClass('sparx');
                    this.getCell(sparx.x, sparx.y).el.addClass('sparx');
                };

                this.renderSparxs = function() {
                    // edge sparxs
                    for (let sparx_index in this.edgeSparxs) {
                        this.renderSparx(this.edgeSparxs[sparx_index]);
                    }
                    // internal sparxs
                    for (let sparx_index in this.sparxs) {
                        this.renderSparx(this.sparxs[sparx_index]);
                    }
                };

                this.renderHud = function() {
                    xnHudCol.text(this.board.meta.xn + '');
                    scoreHudCol.text(this.board.meta.score + '');
                };

                this.render = function() {
                    this.renderHud();
                    this.renderHero();
                    this.renderSparxs();
                };

                this.fullRender = function() {
                    for (let row_index in this.board.cells) {
                        let row = this.board.cells[row_index];
                        for (let cell_index in row) {
                            let cell = row[cell_index];
                            if (cell.state === CELL_TYPES.FULL) {
                                cell.el.addClass('full');
                            }
                        }
                    }
                    this.render();
                };

                this.initBoard();

                const {
                    level,
                    h,
                    w,
                    timeSpeed,
                    speed,
                    time,
                    full,
                    objective,
                    xn
                } = this.board.meta;

                this.showNotice = function(html) {
                    notice.html(html);
                    notice.removeClass('hidden');
                };

                this.gameOver = function() {
                    this.stopPlaying();

                    setTimeout(function() {
                        boardElement.removeClass('hide-cursor');
                        playSound('game_over');
                        let params = [];
                        params.push('speed=' + (speed));
                        params.push('objective=' + (objective));
                        params.push('w=' + (this.board.meta.w));
                        params.push('h=' + (this.board.meta.h));
                        this.showNotice('Game Over<br/><a href="?' + (params.join('&')) + '">Restart</a>');
                    }, STANDARD_WAIT / 5);
                };

                this.die = function() {
                    this.stopPlaying();

                    playSound('hit');

                    this.board.meta.xn -= 1;

                    if (this.board.meta.xn <= 0) {
                        this.fullRender();
                        this.gameOver();
                    } else {
                        this.fullRender();

                        this.board.meta.time = this.board.meta.initialTime;

                        setTimeout(function() {
                            this.stopStrixing();
                            this.initHero();
                            this.fullRender();

                            this.board.meta.playing = true;
                        }, STANDARD_WAIT);
                    }
                };

                this.win = function() {
                    this.stopPlaying();

                    playSound('win');
                    this.fullRender();

                    boardElement.removeClass('hide-cursor');

                    let params = [];
                    params.push('level=' + (level + 1));
                    params.push('speed=' + (speed));
                    params.push('objective=' + (objective));
                    params.push('previous_score=' + (this.board.meta.score));
                    params.push('xn=' + (this.board.meta.xn + 1));
                    params.push('w=' + (this.board.meta.w));
                    params.push('h=' + (this.board.meta.h));
                    this.showNotice('<a href="?' + (params.join('&')) + '">Next level!</a>');
                };

                let timerInterval = setInterval(
                    function() {
                        if (!this.board.meta.playing) {
                            return;
                        }
                        this.board.meta.time -= 1;
                        if (this.board.meta.time >= 0) {
                            timeHudCol.text(this.board.meta.time + '');
                        } else {
                            this.die();
                        }
                    },
                    timeSpeed
                );

                this.outOfBoundaries = function(target_x, target_y) {
                    return (target_x < 0)
                        || (target_x >= this.board.meta.w)
                        || (target_y < 0)
                        || (target_y >= this.board.meta.h);
                };

                this.boundariesIfNeeded = function(obj) {
                    let { h_dir, v_dir } = obj;
                    let target_x = obj.x|0;
                    let target_y = obj.y|0;
                    h_dir = (h_dir !== null) ? h_dir|0 : 0;
                    v_dir = (v_dir !== null) ? v_dir|0 : 0;
                    target_x += h_dir;
                    target_y += v_dir;

                    if (this.outOfBoundaries(target_x, target_y)) {
                        if (target_x < 0 || target_x >= this.board.meta.w) {
                            obj.h_dir = null;
                        }
                        if (target_y < 0 || target_y >= this.board.meta.h) {
                            obj.v_dir = null;
                        }
                    }
                };

                this.bounceIfNeeded = function(obj, bounceStatus) {
                    let tries = [
                        { h_dir: obj.h_dir, v_dir: obj.v_dir },
                        { h_dir: obj.h_dir * -1, v_dir: obj.v_dir },
                        { h_dir: obj.h_dir, v_dir: obj.v_dir * -1 },
                        { h_dir: obj.h_dir * -1, v_dir: obj.v_dir * -1 }
                    ];

                    for (let i in tries) {
                        let { h_dir, v_dir } = tries[i];

                        let target_x = obj.x|0;
                        let target_y = obj.y|0;
                        h_dir = (h_dir !== null) ? h_dir|0 : 0;
                        v_dir = (v_dir !== null) ? v_dir|0 : 0;
                        target_x += h_dir;
                        target_y += v_dir;

                        if (this.outOfBoundaries(target_x, target_y)) {
                            continue;
                        }
                        if (this.getCell(target_x, target_y).state == bounceStatus) {
                            continue;
                        }
                        obj.h_dir = h_dir;
                        obj.v_dir = v_dir;
                        return;
                    }
                    obj.h_dir = (obj.h_dir * -1)|0;
                    obj.v_dir = (obj.v_dir * -1)|0;
                };

                this.updateCoords = function(obj, bounceStatus = null) {
                    obj.old_x = obj.x;
                    obj.old_y = obj.y;
                    if (bounceStatus !== null) {
                        this.bounceIfNeeded(obj, bounceStatus);
                    } else if (obj.h_dir !== null || obj.v_dir !== null) {
                        this.boundariesIfNeeded(obj);
                    }
                    obj.x = obj.x|0;
                    obj.y = obj.y|0;
                    let h_dir = (obj.h_dir !== null) ? obj.h_dir|0 : 0;
                    let v_dir = (obj.v_dir !== null) ? obj.v_dir|0 : 0;
                    obj.x += h_dir;
                    obj.y += v_dir;
                };

                this.getArounds = function(x, y, exclude = []) {
                    return [{
                        x: x - 1,
                        y: y
                    }, {
                        x: x,
                        y: y - 1
                    }, {
                        x: x,
                        y: y + 1
                    }, {
                        x: x + 1,
                        y: y
                    }].filter(function(target) {
                        if (target.x < 0 ||
                            target.x >= this.board.meta.w ||
                            target.y < 0 ||
                            target.y >= this.board.meta.h) {
                            return false;
                        }
                        if (exclude.indexOf(target.x + '-' + target.y) >= 0) {
                            return false;
                        }
                        return true;
                    }).map(function(c) {
                        return this.getCell(c.x, c.y);
                    });
                };

                // Score uses this formula:
                // 
                //       number of filled cells in single run
                //              multiplied
                //       percentage of filled space in single run (minimum 1)
                //              multiplied
                //       level
                // 
                this.updateScore = function(filled) {
                    filledScore = filled
                        * (Math.max(
                            this.calcPerc(filled, this.board.meta.totalEmptyCells),
                            1
                        )
                        * this.board.meta.level
                    );
                    this.board.meta.score += filledScore;
                };

                this.floodFill = function() {
                    let filled = 0;
                    // fill the strix before doing anything else
                    for (let i in this.hero.strix) {
                        this.hero.strix[i].state = CELL_TYPES.FULL;
                        filled += 1;
                    }
                    // fill candidates with TENTATIVE state
                    for (let y in this.board.cells) {
                        for (let x in this.board.cells[y]) {
                            if (this.board.cells[y][x].state == CELL_TYPES.EMPTY) {
                                this.board.cells[y][x].state = CELL_TYPES.TENTATIVE;
                            }
                        }
                    }
                    // start from the enemies and see if we can reach the candidates
                    let targets = this.sparxs.map(function(s) {
                        return this.getCell(s.x, s.y);
                    });

                    do {
                        let newTargets = [];
                        for (let i = (targets.length - 1); i >= 0; --i) {
                            let target = targets[i];
                            if (target.state == CELL_TYPES.EMPTY) {
                                continue;
                            }
                            if (target.state == CELL_TYPES.TENTATIVE) {
                                target.state = CELL_TYPES.EMPTY;
                                newTargets = newTargets.concat(
                                    this.getArounds(target.x, target.y)
                                ).filter(function(t) {
                                    return t.state == CELL_TYPES.TENTATIVE;
                                });
                            }
                        }
                        targets = newTargets;
                    } while (targets.length > 0);

                    // remaining TENTATIVE cells can be filled
                    let count = 0;
                    for (let y in this.board.cells) {
                        for (let x in this.board.cells[y]) {
                            if (this.board.cells[y][x].state == CELL_TYPES.TENTATIVE) {
                                this.board.cells[y][x].state = CELL_TYPES.FULL;
                                filled += 1;
                            }
                        }
                    }

                    // update score
                    this.updateScore(filled);
                };

                this.collisions = function() {
                    // strix
                    if (this.hero.strix.length > 0) {
                        let lastStrixIndex = this.hero.strix.length - 1;
                        for (let i in this.hero.strix) {
                            if (lastStrixIndex == i) {
                                continue;
                            }
                            let strixCell = this.hero.strix[i];
                            if (this.hero.x == strixCell.x && this.hero.y == strixCell.y) {
                                this.die();
                                return;
                            }
                        }
                    }
                    // edge sparxs
                    for (let i in this.edgeSparxs) {
                        let edgeSparx = this.edgeSparxs[i];
                        if (edgeSparx.x == this.hero.x && edgeSparx.y == this.hero.y) {
                            this.die();
                            return;
                        }
                    }
                    // sparxs
                    for (let i in this.sparxs) {
                        let sparx = this.sparxs[i];
                        if (sparx.x == this.hero.x && sparx.y == this.hero.y) {
                            this.die();
                            return;
                        }
                        for (let j in this.hero.strix) {
                            let strixCell = this.hero.strix[j];
                            if (sparx.x == strixCell.x && sparx.y == strixCell.y) {
                                this.die();
                                return;
                            }
                        }
                    }
                };

                this.calcPerc = function(partial, total) {
                    return ((partial * 100) / total)|0;
                };

                this.winningConditions = function() {
                    let total = 0;
                    for (let y in this.board.cells) {
                        for (let x in this.board.cells[y]) {
                            if (this.board.cells[y][x].state == CELL_TYPES.FULL) {
                                total += 1;
                            }
                        }
                    }
                    let subtotal = total;
                    total -= this.board.meta.totalEdgeCells;

                    let perc = this.calcPerc(total, this.board.meta.totalEmptyCells);
                    fullHudCol.text(perc + '');
                    if (perc >= objective) {
                        this.win();
                    }
                };

                // controller
                jQuery(window).on('keydown', function(e) {
                    if (!this.board.meta.playing) {
                        return;
                    }

                    // down
                    if (e.keyCode == 40) {
                        this.hero.h_dir = null;
                        this.hero.v_dir = 1;
                    // right
                    } else if (e.keyCode == 39) {
                        this.hero.h_dir = 1;
                        this.hero.v_dir = null;
                    // up
                    } else if (e.keyCode == 38) {
                        this.hero.h_dir = null;
                        this.hero.v_dir = -1;
                    // left
                    } else if (e.keyCode == 37) {
                        this.hero.h_dir = -1;
                        this.hero.v_dir = null;
                    }
                });

                this.start = function() {
                    this.board.meta.playing = true;
                    let gameLoop = setInterval(
                        function() {
                            if (!this.board.meta.playing) {
                                return;
                            }

                            let lightRender = true;
                            // update hero
                            this.updateCoords(this.hero);
                            let target = this.getCell(this.hero.x, this.hero.y);
                            if (target.state == CELL_TYPES.EMPTY) {
                                this.hero.strix.push(target);
                            } else if (this.isStrixing()) {
                                this.floodFill();
                                this.stopStrixing();
                                lightRender = false;
                            }
                            
                            // update sparxs
                            // -- edge sparxs
                            for (let sparx_index in this.edgeSparxs) {
                                this.updateCoords(this.edgeSparxs[sparx_index], CELL_TYPES.EMPTY);
                            }
                            // -- internal sparxs
                            for (let sparx_index in this.sparxs) {
                                this.updateCoords(this.sparxs[sparx_index], CELL_TYPES.FULL);
                            }

                            // check for collisions
                            this.collisions();

                            // check win
                            this.winningConditions();

                            // render
                            if (lightRender) {
                                this.render();
                            } else {
                                this.fullRender();
                            }
                        },
                        speed
                    );
                };

                this.showNotice('<a href="#" autofocus>Start!</a>');
                notice.find('a').on('click', function(e) {
                    e.preventDefault();
                    boardElement.addClass('hide-cursor');
                    setTimeout(function() {
                        this.start();
                    }, STANDARD_WAIT);
                    notice.addClass('hidden');
                });

                return this;
            };

            Game();
        }());
    </script>
</body>

</html>
